  getValueWithoutMasking: function getValueWithoutMasking(value) {
    value = value.replace(/\-/g, '');
    value = value.replace(/\_/g, '');
    value = value.replace(/\+/g, '');
    value = value.replace(/\|/g, '');
    value = value.replace(/\(/g, '');
    value = value.replace(/\)/g, '');
    return value;
  },
