  uploadImage: function uploadImage(parent_id, objId, width, height) {
    var disableButtonId = arguments.length > 4 && arguments[4] !== undefined ? arguments[4] : null;
    var maxImgSize = arguments.length > 5 && arguments[5] !== undefined ? arguments[5] : 1;
    App.Constants.CROPPER_WIDTH = width;
    App.Constants.CROPPER_HEIGHT = height;
    App.Constants.CROPPER_PARENT_ID = parent_id;
    $('#upload-demo').croppie('destroy');
    App.Constants.$uploadCrop = $('#upload-demo').croppie({
      viewport: {
        width: width,
        height: height
      },
      enforceBoundary: false,
      enableExif: true
    });
    var obj = document.getElementById(objId);
    App.Constants.imageId = $('#' + parent_id + ' #' + objId).data('id');
    App.Constants.tempFilename = $('#' + parent_id + ' #' + objId).val();
    var isValid = App.Helpers.validateImageFile(App.Constants.tempFilename);
    if (!isValid) {
      App.Helpers.showErrorMessage({
        'error': 'Invalid Image Format'
      });
      return false;
    }
    var imageSize = App.Helpers.validateImageSize(obj, maxImgSize);
    if (!imageSize) {
      App.Helpers.showErrorMessage({
        'error': 'Image size cannot be greater than ' + maxImgSize + 'mb'
      });
      return false;
    }
    $('#cancelCropBtn').data('id', App.Constants.imageId);
    App.Helpers.readFile($('#' + parent_id + ' #' + objId).get(0));
    if (disableButtonId) {
      $("#".concat(disableButtonId)).removeAttr('disabled');
    }
  },
  validateImageFile: function validateImageFile(filename) {
    var extension = filename.substr(filename.lastIndexOf('.')).toLowerCase();
    var imageValidExtensions = ['.png', '.jpg', '.jpeg', '.svg', '.webp', '.tif', '.tiff', '.bmp', '.raw', '.cr2', '.ico', '.cur'];
    if (imageValidExtensions.includes(extension)) {
      return true;
    }
    return false;
  },
  validateImageSize: function validateImageSize(obj, maxImgSize) {
    var size = parseFloat(obj.files[0].size / (1024 * 1024)).toFixed(2);
    if (size > maxImgSize) {
      return false;
    }
    return true;
  },
  readFile: function readFile(input) {
    if (input.files && input.files[0]) {
      var reader = new FileReader();
      reader.onload = function (e) {
        $('#cropImagePop #upload-demo').addClass('ready');
        $('#cropImagePop').modal('show');
        App.Constants.rawImg = e.target.result;
      };
      reader.readAsDataURL(input.files[0]);
    }
  },
  cropImage: function cropImage() {
    var uploadToS3 = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : false;
    var storeId = arguments.length > 1 && arguments[1] !== undefined ? arguments[1] : null;
    var isProduct = arguments.length > 2 && arguments[2] !== undefined ? arguments[2] : false;
    var isCampaign = arguments.length > 3 && arguments[3] !== undefined ? arguments[3] : false;
    App.Constants.$uploadCrop.croppie('result', {
      type: 'base64',
      size: {
        width: App.Constants.CROPPER_WIDTH,
        height: App.Constants.CROPPER_HEIGHT
      }
    }).then(function (resp) {
      $('#' + App.Constants.CROPPER_PARENT_ID + ' #item-img-output').attr('src', resp);
      $('#' + App.Constants.CROPPER_PARENT_ID + ' #cropped_image').val(resp);
      $('#cropImagePop').modal('hide');
      $('#brandverseImage').val('');
      if (uploadToS3 == App.Constants.ON) {
        App.MerchantBranding.uploadBrandImages(storeId);
      }
      if (isProduct == App.Constants.ON) {
        App.Products.uploadProductImages();
      }
      if (isCampaign == App.Constants.ON) {
        App.Campaigns.uploadCampaignImages();
      }
    });
  },
